description:
Deck the halls with love and joy in Delicious - Emily's Holiday Season, a wonderful time management sequel to warm up your holidays!
 &lt;a href=&quot;
http://www.doublegames.name/images/screenshots/delicious-emilys-holiday-season_3_big.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.doublegames.name/images/screenshots/delicious-emilys-holiday-season_3_big.jpg&lt;/a&gt;

It's winter in Snuggford and Emily is preparing for her family's holiday party at a cozy little lodge. While making arrangements, the new owner quickly recognizes her skills and hires her to run the place. Soon, romance fills the air as two suitors vie for Emily's attention. Can Emily carefully balance her new duties and build a relationship between one of these two men? Whom will she choose to fall in love with?
 &lt;a href=&quot;
http://img573.imageshack.us/img573/5193/deliciousemilysholidays.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://img573.imageshack.us/img573/5193/deliciousemilysholidays.jpg&lt;/a&gt;

Join Emily in this romantic new adventure through a winter wonderland! Meet her family and catch up with friends. Help and serve guests delicious holiday treats. Go to the winter fair and visit the old farm, now an ice rink. Take part in jolly activities like making snow-angels and snowmen, ice-skating, skiing, and throwing snowballs. Find out who the lucky guy will be!
