http://i1-games.softpedia-static.com/screenshots/Delicious-Emilys-Holiday-Season_1.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://i1-games.softpedia-static.com/screenshots/Delicious-Emilys-Holiday-Season_1.jpg&lt;/a&gt;

With five locations, 50 new events, festive upgrades, and a fresh set of fireworks, Emily's frolicking will brighten up your holidays with heartwarming fun!
